import React from 'react';

export default class P2 extends React.Component {

    // constructor(props) {
    //     super(props);
    // }
    componentWillMount() {
    }

    render(){
        const fthis=this;
        return(

            <div className="show"
            style={{
                 overflow:"scroll"
                ,backgroundColor:"red"
                ,height:"1000px"
                ,width:"300px"
                }}>
                    <button onClick={() => {
                    fthis.props.myParent.setState({ focusOnPage: "p3" });
                }}
                style={{ color: '#fff' }}>
                    <h1>p2-top</h1>
                    <h2>Go to P3</h2>
                </button>
               
                <button onClick={() => {
                    fthis.props.myParent.setState({ focusOnPage: "p1" });
                }}>
                    <h1 >p2-top</h1>
                    <h2>Back to P1</h2>
                </button>


                <button
                    style={{
                        color: '#fff',left:0, top: 950, position: "absolute"
                    }}
                    onClick={() => {
                        fthis.props.myParent.setState({ focusOnPage: "p3" });
                    }}>
                    <h1>p2-bottom</h1>
                    <h2>Go to P3</h2>
                </button>
                <button
                    style={{
                        color: '#fff',left:"45%", top: 950, position: "absolute"
                    }}
                    onClick={() => {
                        fthis.props.myParent.setState({ focusOnPage: "p1" });
                    }}>
                    <h1>p2-bottom</h1>
                    <h2>Back to P1</h2>
                </button>
                </div>
        )
    }

}
